// 报废接口对应出库单接口
import request from '@/utils/request';
export function getData_a(query) {
  //查询出库凭证列表
  return request({
    url: "/iwms/outStocks",
    method: 'get',
    params: query
  });
}
export function creatData_a(query) {
  //创建报废申请单
  return request({
    url: "/iwms/outStocks",
    method: 'post',
    data: query
  });
}
export function getData_a_1(query) {
  //查询出库凭证明细
  return request({
    url: "/iwms/outStocks/".concat(query.outOrderNumber, "/details"),
    method: 'get',
    params: query
  });
}
